import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CheckCibilComponent } from 'src/app/oe/check-cibil/check-cibil.component';
import { VerifyDocComponent } from 'src/app/oe/verify-doc/verify-doc.component';
import { RouterModule, Routes } from '@angular/router';


const routes: Routes = [
  {
    path:"checkCibil",component:CheckCibilComponent
  },
  {
    path:"verifyDoc",component:VerifyDocComponent
  }
];
@NgModule({
  declarations: [],
  imports: 
    [RouterModule.forChild(routes)],

  exports: [RouterModule]
})
export class OeRoutingModule { }
